import React from 'react';
import { Box, Container, Typography } from '@mui/material';

const PasswordReset = () => {
  return (
    <>

    <Container component="main" maxWidth="xs">
      <Box
        sx={{
          marginTop: 15,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
        }}
      >
        <Typography component="h1" variant="h5">
          Password Reset
        </Typography>
        {/* 在这里添加密码重置表单 */}
      </Box>
    </Container></>
  );
};

export default PasswordReset;
